If E_CFLD = 0, then F_CFLD = 0 to denote true zeros;
If E_CFLD IS NULL, F_CFLD = 1 to denote where missing data has been updated to zero;
If E_CFLD > 0 and EPL_CFLD = 0, then F_CFLD = 2 to denote non-zero values
with a percentile rank of zero;
All others receive a flag of 9.

